import React from 'react'

import { BiChevronRight } from "react-icons";


const NavSM = () => {


    return (
        <div>

            <div  >It's All Start Here</div>
         
            <BiChevronRight />
        
        </div>
    );
};
const NavMd = () => { };
const NavLg = () => { };


//_________________________________


const Navbar = () => {
    return (
        <div>

            <nav>

                <div className="md:hidden"> 
                
                <NavSM />
                
                </div>   {/* mobile Screen*/}

                <div className="hidden md:flex lg:hidden">  </div>    {/* medium Screen*/}

                <div className="hidden lg:flex">   </div>   {/* Large Screen*/}


            </nav>

        </div>
    );
};

export default Navbar
